// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./field/finiteField.sol";
import "./field/quadraticExtension.sol";
import "./field/sexticExtension.sol";
import "./field/twelveExtension.sol";

contract Curve {
    enum PointType {
        Affine,
        PointAtInfinity
    }

    struct Point_0 {
        PointType pointType;
        FiniteField field;
        FiniteField.Zp x;
        FiniteField.Zp y;
    }

    struct Point_1 {
        PointType pointType;
        QuadraticExtension field;
        QuadraticExtension.Zp_2 x;
        QuadraticExtension.Zp_2 y;
    }

    struct Point_2 {
        PointType pointType;
        TwelveExtension field;
        TwelveExtension.Zp_12 x;
        TwelveExtension.Zp_12 y;
    }

    uint256 private order;
    Point_0 private g0;
    Point_1 private g1;

    function isOnCurve_0(
        FiniteField f,
        Point_0 memory p
    ) public view returns (bool) {
        if (p.pointType == PointType.PointAtInfinity) return false;
        FiniteField.Zp memory l = f.mul(p.y, p.y);
        FiniteField.Zp memory r = f.sum(
            f.mul(f.mul(p.x, p.x), p.x),
            f.mul_nonres(f.createElement(4))
        );
        return f.equals(l, r);
    }

    function isOnCurve_1(
        QuadraticExtension q,
        Point_1 memory p
    ) public view returns (bool) {
        if (p.pointType == PointType.PointAtInfinity) return false;
        QuadraticExtension.Zp_2 memory l = q.mul(p.y, p.y);
        QuadraticExtension.Zp_2 memory r = q.sum(
            q.mul(q.mul(p.x, p.x), p.x),
            q.mul_nonres(q.createElement(FiniteField.Zp(4), FiniteField.Zp(0)))
        );
        return q.equals(l, r);
    }
}

