// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./quadraticExtension.sol"; // Importa il contratto quadraticExtension

contract SexticExtension {
    struct Zp_6 {
        QuadraticExtension.Zp_2 a;
        QuadraticExtension.Zp_2 b;
        QuadraticExtension.Zp_2 c;
    }

    QuadraticExtension q;

    constructor(QuadraticExtension quad) {
        q = quad;
    }

    function createElement(
        QuadraticExtension.Zp_2 memory a,
        QuadraticExtension.Zp_2 memory b,
        QuadraticExtension.Zp_2 memory c
    ) public pure returns (Zp_6 memory) {
        return Zp_6(a, b, c);
    }

    function sum(
        Zp_6 memory x,
        Zp_6 memory y
    ) public view returns (Zp_6 memory) {
        return createElement(q.sum(x.a, y.a), q.sum(x.b, y.b), q.sum(x.c, y.c));
    }

    function sub(
        Zp_6 memory x,
        Zp_6 memory y
    ) public view returns (Zp_6 memory) {
        return createElement(q.sub(x.a, y.a), q.sub(x.b, y.b), q.sub(x.c, y.c));
    }

    function mul(
        Zp_6 memory x,
        Zp_6 memory y
    ) public view returns (Zp_6 memory) {
        QuadraticExtension.Zp_2 memory t0 = q.mul(x.a, y.a);
        QuadraticExtension.Zp_2 memory t1 = q.sum(
            q.mul(x.a, y.b),
            q.mul(x.b, y.a)
        );
        QuadraticExtension.Zp_2 memory t2 = q.sum(
            q.sum(q.mul(x.a, y.c), q.mul(x.b, y.b)),
            q.mul(x.c, y.a)
        );
        QuadraticExtension.Zp_2 memory t3 = q.mul_nonres(
            q.sum(q.mul(x.b, y.c), q.mul(x.c, y.b))
        );
        QuadraticExtension.Zp_2 memory t4 = q.mul_nonres(q.mul(x.c, y.c));
        return createElement(q.sum(t0, t3), q.sum(t1, t4), t2);
    }

    function inverse(Zp_6 memory x) public view returns (Zp_6 memory) {
        QuadraticExtension.Zp_2 memory t0 = q.sub(
            q.mul(x.a, x.a),
            q.mul_nonres(q.mul(x.b, x.c))
        );
        QuadraticExtension.Zp_2 memory t1 = q.sub(
            q.mul_nonres(q.mul(x.c, x.c)),
            q.mul(x.a, x.b)
        );
        QuadraticExtension.Zp_2 memory t2 = q.sub(
            q.mul(x.b, x.b),
            q.mul(x.a, x.c)
        );
        QuadraticExtension.Zp_2 memory t3 = q.sum(
            q.sum(q.mul(x.a, t0), q.mul_nonres(q.mul(x.c, t1))),
            q.mul_nonres(q.mul(x.b, t2))
        );
        return createElement(q.div(t0, t3), q.div(t1, t3), q.div(t2, t3));
    }

    function div(
        Zp_6 memory x,
        Zp_6 memory y
    ) public view returns (Zp_6 memory) {
        return mul(x, inverse(y));
    }

    function mul_nonres(Zp_6 memory x) public view returns (Zp_6 memory) {
        return createElement(q.mul_nonres(x.c), x.a, x.b);
    }

    function equals(Zp_6 memory x, Zp_6 memory y) public view returns (bool) {
        return (q.equals(x.a, y.a) && q.equals(x.b, y.b) && q.equals(x.c, y.c));
    }

    function zero() public view returns (Zp_6 memory) {
        return Zp_6(q.zero(), q.zero(), q.zero());
    }
}

